import React from 'react';
import { Text, View, TextInput, Button } from 'react-native';
import Slider from '@react-native-community/slider';

const ChampAge = ({bonAge, age, changeAge, changeAgeOk}) =>{
    [ageTI, setAgeTI] = useState(age)
    return  <View>
    <TextInput style = {StyleSheet.input} value = {ageTI} onChangeText = {(value) => {setAgeTI(value);}} onEndEditing = {(value) =>{ changeAgeOk(value==bonAge); changeAge(value)}} />
    <Slider
        value= {age}
        onValueChange={(value) => changeAge(value)}
        onSlidingComplete={(value) => changeAgeOk(value==bonAge)}
        step = {1}
        minimumValue = {20}
        maximumValue = {80}
    />
    <Button title="Test" onPress ={()=>changeAge(77)}/>
</View>
}

export default ChampAge;
